Template.trainer.onCreated(function () {                                                                               // 1
	var template = Template.instance();                                                                                   // 2
	template.isAlphabetic = new ReactiveVar(true);                                                                        // 3
	template.isLength64 = new ReactiveVar(true);                                                                          // 4
                                                                                                                       //
	template.autorun(function () {                                                                                        // 6
		template.subscribe('vocabularyAll'); // Vocabulary.find()                                                            // 7
		template.subscribe('ownedFavourites'); // Favourites.find()                                                          // 6
	});                                                                                                                   // 6
});                                                                                                                    //
                                                                                                                       //
Template.trainer.helpers({                                                                                             // 12
	isAlphabetic: function () {                                                                                           // 13
		function isAlphabetic() {                                                                                            //
			return Template.instance().isAlphabetic.get();                                                                      // 14
		}                                                                                                                    //
                                                                                                                       //
		return isAlphabetic;                                                                                                 //
	}(),                                                                                                                  //
	isLength64: function () {                                                                                             // 16
		function isLength64() {                                                                                              //
			return Template.instance().isLength64.get();                                                                        // 17
		}                                                                                                                    //
                                                                                                                       //
		return isLength64;                                                                                                   //
	}()                                                                                                                   //
});                                                                                                                    //
                                                                                                                       //
Template.trainer.events({                                                                                              // 21
	'click .btn-settings-trainer': function () {                                                                          // 22
		function clickBtnSettingsTrainer(event, template) {                                                                  //
			var oldValue = Session.get(SETTINGS_TRAINER) || false;                                                              // 23
			Session.set(SETTINGS_TRAINER, !oldValue);                                                                           // 24
			console.log(Session.get(SETTINGS_TRAINER));                                                                         // 25
                                                                                                                       //
			// log                                                                                                              //
			Log.detail();                                                                                                       // 22
		}                                                                                                                    //
                                                                                                                       //
		return clickBtnSettingsTrainer;                                                                                      //
	}(),                                                                                                                  //
	'keyup [name="term"]': function () {                                                                                  // 30
		function keyupNameTerm(event, template) {                                                                            //
			var value = event.target.value.toLowerCase();                                                                       // 31
                                                                                                                       //
			if (!Session.get(INPUT_OCCURED)) {                                                                                  // 33
				Session.set(INPUT_OCCURED, true);                                                                                  // 34
			}                                                                                                                   //
                                                                                                                       //
			if (value !== '') {                                                                                                 // 37
				// check if string is valid                                                                                        //
				if (Validate.isAlphabetic(value)) {                                                                                // 39
					template.isAlphabetic.set(true);                                                                                  // 40
				} else {                                                                                                           //
					template.isAlphabetic.set(false);                                                                                 // 42
				}                                                                                                                  //
				if (Validate.isLength64(value)) {                                                                                  // 44
					template.isLength64.set(true);                                                                                    // 45
				} else {                                                                                                           //
					template.isLength64.set(false);                                                                                   // 47
				}                                                                                                                  //
			}                                                                                                                   //
                                                                                                                       //
			// TODO exclude spaces                                                                                              //
			// && event.keyCode === 13                                                                                          //
			if (value !== '') {                                                                                                 // 30
				if (template.isAlphabetic.get() && template.isLength64.get()) {                                                    // 54
					var term = this.term.toLowerCase();                                                                               // 55
                                                                                                                       //
					if (term === value) {                                                                                             // 57
						if (!Session.get(REVEALED)) {                                                                                    // 58
							Session.set(REVEALED, true);                                                                                    // 59
						}                                                                                                                //
						if (!Session.get(TERM_RIGHT)) {                                                                                  // 61
							Session.set(TERM_RIGHT, true);                                                                                  // 62
						}                                                                                                                //
						event.target.disabled = true;                                                                                    // 64
                                                                                                                       //
						setTimeout(function () {                                                                                         // 66
							Session.set(REVEALED, false);                                                                                   // 67
							Session.set(TERM_RIGHT, false);                                                                                 // 68
							Session.set(INPUT_OCCURED, false);                                                                              // 69
							// disable after correct term and autofocus input field for the next word                                       //
							if (event.target) {                                                                                             // 66
								event.target.disabled = false;                                                                                 // 72
								event.target.value = '';                                                                                       // 73
								if (event.target.disabled === true) {                                                                          // 74
									event.target.disabled = false;                                                                                // 75
									event.target.autofocus = true;                                                                                // 76
								}                                                                                                              //
								event.target.focus();                                                                                          // 78
							}                                                                                                               //
							// log                                                                                                          //
							Log.detail();                                                                                                   // 66
							Entry.setNext();                                                                                                // 82
						}, 2000);                                                                                                        //
					} else {                                                                                                          //
						Session.set(TERM_RIGHT, false);                                                                                  // 85
                                                                                                                       //
						var termArray = R.split('', term);                                                                               // 87
						var f = function () {                                                                                            // 88
							function f(x, y) {                                                                                              // 88
								var space = "_";                                                                                               // 89
								if (x === y) {                                                                                                 // 90
									return x;                                                                                                     // 91
								} else {                                                                                                       //
									return space;                                                                                                 // 93
								}                                                                                                              //
							}                                                                                                               //
                                                                                                                       //
							return f;                                                                                                       //
						}();                                                                                                             //
						var cheese = R.zipWith(f, term, value);                                                                          // 96
						while (cheese.length < term.length) {                                                                            // 97
							cheese = R.append('_', cheese);                                                                                 // 98
						}                                                                                                                //
                                                                                                                       //
						// let countMatch = term.length - R.filter(R.equals('_'), cheese).length;                                        //
						// Session.set(COUNT_LETTERS_MATCH, countMatch);                                                                 //
                                                                                                                       //
						cheese = R.join(' ', cheese);                                                                                    // 84
						Session.set(TERM_CACHE, cheese);                                                                                 // 105
					}                                                                                                                 //
				}                                                                                                                  //
			}                                                                                                                   //
                                                                                                                       //
			if (value === '') {                                                                                                 // 111
				template.isAlphabetic.set(true);                                                                                   // 112
				template.isLength64.set(true);                                                                                     // 113
                                                                                                                       //
				var _cheese = '';                                                                                                  // 115
				while (_cheese.length < this.term.length) {                                                                        // 116
					_cheese = R.append('_', _cheese);                                                                                 // 117
				}                                                                                                                  //
				_cheese = R.join(' ', _cheese);                                                                                    // 119
				Session.set(TERM_CACHE, _cheese);                                                                                  // 120
			}                                                                                                                   //
		}                                                                                                                    //
                                                                                                                       //
		return keyupNameTerm;                                                                                                //
	}()                                                                                                                   //
});                                                                                                                    //
