/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
//                                                                                                                     //
// client/views/high/doc/template.doc.js                                                                               //
//                                                                                                                     //
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
                                                                                                                       //
                                                                                                                       // 1
Template.__checkName("doc");                                                                                           // 2
Template["doc"] = new Template("Template.doc", (function() {                                                           // 3
  var view = this;                                                                                                     // 4
  return HTML.Raw("<div class=\"ui container\">\n		<div class=\"row\">\n			<br>\n			<h1>Dokumentation</h1>\n			<br>\n			<h2 class=\"ui dividing header\">\n				Start\n			</h2>\n			<p>\n				Auf der Startseite findest du neben einer einfhrenden Erklrung der zentralen Funktionen zwei Top 5-Listen, welche die beliebtesten Begriffe anzeigen - deine persnlichen sowie die ingesamt beliebtesten Begriffe.\n			</p>\n			<p>\n				ber die Feedback-Funktion hast du die Mglichkeit direkt mit uns in Kontakt zu treten. Alternativ oder falls es nicht ganz so dringend ist kanst du dich auch am Ende des Testzeitraums in einem Fragebogen uern. Deine\n				Anfragen werden vertraulich behandelt und nur im Zusammenhang mit der Nutzerstudie ausgewertet.\n			</p>\n			<p>\n				Am Ende des Testzeitraums wird ein Fragebogen freigeschalten - ber die Startseite wirst du darber informiert.\n			</p>\n			<br>\n			<h2 class=\"ui dividing header\">\n				Trainer\n			</h2>\n			<p>\n				Im Trainer kannst du ber das Men 'Einstellungen' drei verschiedene Optionen whlen - 'Methode', 'Quelle' und 'Reihenfolge'.\n			</p>\n			<br>\n			<h3>Methode</h3>\n			<h3><i>Lesen</i></h3>\n			<p>\n				Hier kannst du die Begriffe und ihre Bedeutungen ansehen, ber das Herzsymbol favorisieren und aus der Favoritenliste lschen. Anders als im Register wird hier jeder Begriff separat dargestellt.\n			</p>\n			<h3><i>Rate Wort</i></h3>\n			<p>\n				Mit aktivierter Methode 'Rate Wort' werden lediglich die Definitionen angezeigt. Mit einem Click auf 'Lsung anzeigen' wird der korrekte Begriff dargestellt.\n			</p>\n			<h3><i>Rate Definition</i></h3>\n			<p>\n				Mit aktivierter Methode 'Rate Definition' wird hingegen der Begriff angezeigt. Mit einem Click auf 'Lsung anzeigen' werden die korrekten Definitionen dargestellt.\n			</p>\n			<h3><i>Eingabetest</i></h3>\n			<p>\n				Mit aktivierter Methode 'Eingabetest' werden die Definitionen des gesuchten Begriffes angezeigt und die hast die Mglichkeit ber die Tastatur in das Textfeld den gesuchten Begriff einzugeben. Mit jeder Eingabe aktualisiert sich die Lsungsanzeige, korrekt\n				gesetzte Buchstaben werden als solche angezeigt, falsch gesetzte Buchstaben erscheinen als Unterstrich ('_'). Ist das komplette Wort korrekt eingegeben, erscheint eine Erfolgsmeldung und der nchste Begriff wird geladen.\n			</p>\n			<p>\n				Mit einem Click auf das Fragezeichen wird die Lsung angezeigt. Daraufhin erfolgt keine automatische Weiterleitung zum nchsten Begriff.\n			</p>\n			<br>\n			<h3>Quelle</h3>\n			<h3><i>Alle</i></h3>\n			<p>\n				Alle im Register enthaltenen Begriffe stehen zur Verfgung.\n			</p>\n			<h3><i>Favoriten</i></h3>\n			<p>\n				Ausschlielich favorisierte Begriffe stehen zur Verfgung.\n			</p>\n			<h3><i>Alle ohne Favoriten</i></h3>\n			<p>\n				Alle im Register enthaltenen Begriffe ohne der favorisierten Begriffe stehen zur Verfgung.\n			</p>\n			<br>\n			<h3>Reihenfolge</h3>\n			<h3><i>Zufall</i></h3>\n			<p>\n				Begriffe werden zufllig aus der gewhlten Quelle entnommen und die Browse-Mglickeit ist auf den Vor-Button reduziert.\n			</p>\n			<h3><i>Alphabet</i></h3>\n			<p>\n				Vom aktuellen Begriff ausgehend werden die Folgebegriffe in alphatetischer Reihenfolge entsprechend der gewhlten Quelle abgerufen.\n			</p>\n			<br>\n			<h2 class=\"ui dividing header\">\n				Register\n			</h2>\n			<p>\n				Im Register werden alle eingetragenen Begriffe alphabtisch sortiert aufgelistet. Du hast du Mglichkeit Begriffe zu favorisieren, von der Favoritenliste zu entfernen oder auch nach Begriffen zu suchen. Sucheingaben mssen mit der Enter-Taste besttigt\n				werden.\n				<br> Es werden smtliche Eintragsrelevanten Inhalte dursucht, d.h. Wort, Definition und Wortart, sodass der Suchbegriff 'Adjektiv' etwa alle Adjektive liefert.\n			</p>\n			<h2 class=\"ui dividing header\">\n					Kompaktmodus\n				</h2>\n			<p>\n				Der Kompaktmodus bietet eine alternative Benutzeroberflche zu der des Trainers. <br>\n				Die Menstruktur ist identisch, allerdings auf Switch-Buttons reduziert. <br>\n				Die Browse-Buttons sind umfassen vollflchig die gesamte zur Verfgung stehende Hhe des Browserfensters,\n				Die Schriftgren passen sich dynamisch an die Bildschirmgre an.\n				Funktional unterscheiden sich der Standard Trainermodus und der Kompaktmodus darin, dass im Kompaktmodus\n				die Methode 'Eingabetest' fehlt. <br>\n				Befindet man sich im Standard Trainermodus mit gewhlter Methode 'Eingabetest' und wechselt in den Kompaktmodus,\n				so wird standardmig auf die Methode 'Lesen' gewechselt.\n			</p>\n		</div>\n	</div>");
}));                                                                                                                   // 6
                                                                                                                       // 7
/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

